Cách Đo Oxy Trong Máu: 
1. Đeo đồng hồ có chiều rộng bằng một ngón tay bên dưới xương cổ tay và đeo ở vị trí thoải mái trên cổ tay; 
2. Sau khi vào chế độ dò tìm oxy trong máu, vui lòng giữ yên, đảm bảo cổ tay của bạn bằng phẳng và đồng hồ hướng lên trên. Nếu bạn đang ngồi, bạn có thể đặt tay lên bàn và đồng hồ hướng lên trên; 
3. Hãy giữ vững cánh tay của bạn cho đến khi bạn nhận được kết quả cuối cùng.
